"js/es6/object/entries.js":"/*\n * Copyright 2017 The Closure Compiler Authors.\n *\n * Licensed under the Apache License, Version 2.0 (the \"License\");\n * you may not use this file except in compliance with the License.\n * You may obtain a copy of the License at\n *\n *     http://www.apache.org/licenses/LICENSE-2.0\n *\n * Unless required by applicable law or agreed to in writing, software\n * distributed under the License is distributed on an \"AS IS\" BASIS,\n * WITHOUT WARRANTIES OR CONDITIONS OF ANY KIND, either express or implied.\n * See the License for the specific language governing permissions and\n * limitations under the License.\n */\n\n'require util/owns';\n'require util/polyfill';\n\n$jscomp.polyfill('Object.entries', function(orig) {\n  if (orig) return orig;\n\n  /**\n   * Returns an array of [key, value] arrays, one for each entry\n   * in the given object.\n   *\n   * @see https://developer.mozilla.org/en-US/docs/Web/JavaScript/Reference/Global_Objects/Object/entries\n   *\n   * @param {!Object<KEY, VALUE>} obj\n   * @return {!Array<!Array<KEY|VALUE>>}\n   * @template KEY, VALUE\n   */\n  var entries = function(obj) {\n    var result = [];\n    for (var key in obj) {\n      if ($jscomp.owns(obj, key)) {\n        result.push([key, obj[key]]);\n      }\n    }\n    return result;\n  };\n\n  return entries;\n}, 'es8', 'es3');\n",
"js/es6/object/fromentries.js":"/*\n * Copyright 2019 The Closure Compiler Authors.\n *\n * Licensed under the Apache License, Version 2.0 (the \"License\");\n * you may not use this file except in compliance with the License.\n * You may obtain a copy of the License at\n *\n *     http://www.apache.org/licenses/LICENSE-2.0\n *\n * Unless required by applicable law or agreed to in writing, software\n * distributed under the License is distributed on an \"AS IS\" BASIS,\n * WITHOUT WARRANTIES OR CONDITIONS OF ANY KIND, either express or implied.\n * See the License for the specific language governing permissions and\n * limitations under the License.\n */\n\n/**\n * @fileoverview\n * @suppress {uselessCode}\n */\n'require es6/symbol';\n'require util/defineproperty';\n'require util/polyfill';\n\n$jscomp.polyfill('Object.fromEntries', function(orig) {\n  if (orig) {\n    return orig;\n  }\n\n  /**\n   * @param {!Iterable<*>} iter\n   * @return {!Object}\n   * @see https://github.com/tc39/proposal-object-from-entries/blob/master/polyfill.js\n   */\n  function fromEntries(iter) {\n    var obj = {};\n\n    $jscomp.initSymbolIterator();\n\n    if (!(Symbol.iterator in iter)) {\n      throw new TypeError('' + iter + ' is not iterable');\n    }\n\n    var iteratorFn = (/** @type {function(): !Iterator<!Object<number, *>>} */ (\n        iter[Symbol.iterator]));\n    var iterator = iteratorFn.call(iter);\n\n    for (var result = iterator.next(); !result.done; result = iterator.next()) {\n      var pair = result.value;\n\n      if (Object(pair) !== pair) {\n        throw new TypeError('iterable for fromEntries should yield objects');\n      }\n\n      var key = pair[0];\n      var val = pair[1];\n      obj[key] = val;\n    }\n\n    return obj;\n  }\n\n  return fromEntries;\n}, 'es_2019', 'es3');\n",
